import { 
    Card,
    Image,
    Modal
} from 'react-bootstrap';
import PropTypes from 'prop-types';

function GaleriaImagensServer(props) {

    const URL_IMG = 'http://localhost/restful/img/';

    return ( 
        props.imagens.map(img => 
            <Card 
                key= {img.codigo}
                style={{ 
                    width: '18rem',
                    margin: '10px',
                    float: 'left' }}>
                <Card.Body closeButton />
                <Card.Body>
                    <Image 
                        src={URL_IMG + img.image}
                        thumbnail/>
                </Card.Body>
            </Card>
        )
    );
}

GaleriaImagensServer.propTypes = {
    imagens: PropTypes.array.isRequired
}

export default GaleriaImagensServer;
